description:
Nieuw-Zeeland
Avontuur / Fantasy
91 minuten

een goeie film

met Sam Neill, Matt Gillanders en Allan Smith

Een tweeling met telepathische krachten wordt opgemerkt door de vriendelijke en vooral buitenaardse meneer Jones. Ooit op de 
aarde beland in een duo, maar nu nog maar enkel en alleen door de hand van de moddermonsters. Slijmerige buitenaardse wezens met 
weinig goeds in de zin, die zich ophouden onder een vulkaan en plannen broeden voor heerschappij op aarde. Of dat nog niet 
afdoende ellende is, hangen ze in de tussentijd in hun menselijke gedaante ook nog eens de chagrijnige buren uit...
